import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Hello from './App';
import reportWebVitals from './reportWebVitals';


const FunFac = (
  <div>
    <h2>The list of things that I would like to do today:</h2>
    <ol>
      <li>This is the number one thing I would like to do today.</li>
      <li>But this is the second thing I would like to do.</li>
      <li>This is another thing that I would like to do next.</li>
      <li>And this is the last thing I would like to do to close for the day.</li>
    </ol>
  </div>
)


ReactDOM.render(
  message,
  document.getElementById('root')
);

